Starring:    Kristina Rose, Phoenix Marie, Danny Mountain, Sasha Grey, Chris Johnson, Alan Stafford, Andy San Dimas, Kagney Linn Karter, Mackenzee Pierce, Sadie West, Juelz Ventura, Chayse Evans, Alyssa Reece, Keni Styles, Jesse Capelli, Dirty Fred, Tommy Gunn, Ron Jeremy, Billy Glide 


Description:  &quot;Malice In Lalaland&quot; is an innovative Miss Lucifer Productions film shot on 35 mm. Based on the two books by Lewis Carroll: &quot;Alice In Wonderland&quot; and &quot;Through The Looking Glass&quot;, we stay true to a strange world and its' even stranger characters. Malice (Sasha Grey) manages to escape from an asylum with the help of Rabbit (Stephen Powers). During her escape from Queenie (Andy San Dimas) and Jabbowski (Dirty Fred), she has the most sexy adventures ever. &quot;Let's Fuck 'N Roll!&quot;
